import React, { Children } from "react";

function Nav({}) {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
      <a className="navbar-brand" href="/">
        Homepage
      </a>
      <a className="navbar-brand" href={ Children } >
        My Reading List
      </a>
    </nav>
  );
}

export default Nav;
